// import React from "react";

function App(){
    const x="I Like the every Name "

    return(
        <div>
            <h1>Rocky Bhai</h1>
            <p>Don't Stop Coding Wait for Page Loading</p>
            <Pass/>
        </div>
        
    )
}

function Pass(){
    return(
        <div>
            <h1>Johnny </h1>
        <Main/>
        </div>
    )
}

function Main(){
    return(
        <div>
            <h1>Holder Das</h1>
            <Jack/>
        </div>
    )
}

function Jack(){
    return(
        <div>
            <h1>Jacky</h1>
            <King/>
        </div>
    )
}

function King(){
    return(
        <div>
            <h1>Dilli vs Rolex</h1>
            <Done/>
        </div>
    )
}

function Done(){
    return(
        <div>
            <h1>Antony Das</h1>
        </div>
    )
}

export default App;
